import React from 'react';
import './sellerlistings.css'

const SellerListingsView = ({ listing, onView }) => {
  return (
    <div className="listing">
        <div className="listingbuttons">
            <button onClick={onView}>View</button>
        </div>
      <h2>{listing.address}</h2>
      <p>Price: ${listing.price}</p>
      <p>Status: {listing.status}</p>
      <p>Number of Views: {listing.viewCount}</p>
      <p>Number of Favourites: {listing.favouriteCount}</p>
      {listing.buyer && <p>Buyer: {listing.buyer}</p>}
    </div>
  );
};

export default SellerListingsView;
